css:
@-moz-document domain('wikipedia.org'){

  @font-face {
    font-family: 'Minion Pro Display';
    src: local('MinionPro-Disp'), local('Minion Pro Display');
  }  
  @font-face {
    font-family: 'Bembo Book MT Pro';
    src: local('BemboBookMTPro'), local('Bembo Book MT Pro');
  }
  @font-face {
    font-family: 'Fell Double Pica';
    src: local('IM_FELL_Double_Pica'), local('IM FELL Double Pica'), url(http://themes.googleusercontent.com/static/fonts/imfelldoublepica/v3/yN1wY_01BkQnO0LYAhXdUol14jEdVOhEmvtCMCVwYak.ttf), url(http://themes.googleusercontent.com/static/fonts/imfelldoublepica/v3/64odUh2hAw8D9dkFKTlWYq0AWwkgdQfsRHec8TYi4mI.ttf);
  }
  @font-face {
    font-family: 'Crimson Text';
    src: local('CrimsonText'), local('CrimsonText'), url(http://themes.googleusercontent.com/static/fonts/crimsontext/v3/3IFMwfRa07i-auYR-B-zNS3USBnSvpkopQaUR-2r7iU.ttf), url(http://themes.googleusercontent.com/static/fonts/crimsontext/v3/a5QZnvmn5amyNI-t2BMkWPMZXuCXbOrAvx5R0IT5Oyo.ttf);
  }

  .portal,
  #left-navigation,
  #right-navigation li,
  #siteNotice,
  #footer,
  a[title="Learn about new features"],
  .vectorTabs,
  .ambox,
  .plainlinks>tbody>tr>td>a>img {
    display: none !important;
  }

  body {
    background: #f9f9f9 !important;
    /*background-color:white !important;*/
    font-family: 'Bembo Book MT Pro', 'Crimson Text', serif !important;;
  }
  h1 span{
    font-family: 'Minion Pro Display', 'Fell Double Pica', serif !important;
      color:#999 !important;
      background-color:transparent !important;
      border:none !important;
      }
  h2,h3,h4,h5,h6>span{
    font-family: 'Minion Pro Display', 'Fell Double Pica', serif !important;
      color:#999 !important;
      background-color:transparent !important;
      border:none !important;
      border-bottom:1px solid #ccc !important;
  }
  a{
    color:#777 !important;
    background-color:transparent !important;
    padding-left:2px;
    padding-right:2px;
    padding-top:2px;
    padding-bottom:2px;
    -moz-transition:all 0.1s !important;
    -webkit-transition:all 0.1s !important;
    -o-transition:all 0.1s !important;
    transition:all 0.1s !important;
    text-decoration:none !important;
    border-radius:4px;
  }
  a:hover{
    color:white !important;
      background-color:#aaa !important; 
  }
  .firstHeading{
    font-size:48px !important;
  }

  #head {
    left: 50px !important;
    right: 50px !important;
    width: auto !important;
    height: 61px !important;
    padding-top: 10px !important;
  }

  .navbox-title,.navbox-group,.navbox-abovebelow{
    background-color:transparent !important;
  }
  
  #head-base,
  #page-base,
  #mw-head-base,
  #mw-page-base {
    height: 40px !important;
    background: transparent !important;
  }
  #mw-head{
/*    position: fixed !important;*/
    top: 0 !important;
    right: 0 !important;
    width: 100% !important;
    background-color:white !important;
    box-shadow:0px 0px 20px 0px #ccc;
  }

  #panel,
  #mw-panel {
    padding: 0 !important;
    top: 10px !important;
    left: 50px !important;
    width: 60px !important;
    height: 60px !important;
  }
  #right-navigation{
    float:left !important;
    margin-top:5px !important;
    margin-bottom:5px !important;
    margin-left:20px;
  }
/*  #p-logo,
  #p-logo a {
    position: fixed !important;
    top: 5px !important;
    left: 5px !important;
    width: 25px !important;
    height: 25px !important;
    color: #333 !important;
    text-shadow: 0 3px 2px #fff;
  }
  #p-logo a{
    background-image:URL('data:image/png;base64,') !important;
    background-size:contain;
  }*/

  #searchform {
    margin-left: 30px !important;
  }
  #simpleSearch label {
    top: 2px !important;
  }
  #simpleSearch,#searchform{
    margin-top:0px !important;
  }
  #content {
    width: auto !important;
    max-width:1200px;
    padding: 22px 30px !important;
    margin: 0px auto !important;
    background: #fff !important;
    box-shadow:0px 0px 20px 0px #ccc;
  }
  #firstHeading {
    font-family: "Minion Pro", serif !important;
  }
  #siteSub {
    color: #888 !important;
    font-size: 11px !important;
    line-height: 1.5 !important;
  }
  #bodyContent p {
    margin: 19px 0 !important;
    line-height: 1.5 !important;
  }

  .infobox>tbody>tr>th,.infobox>tbody>tr{
    background-color:transparent !important;
      border:none !important;
      border-bottom:1px solid #ccc !important;
  }
  .suggestions-result-current{
    background-color:#777 !important;
  }
  .suggestions-results>a{
    padding:0px !important;
    margin:0px !important;
  }

}
